import React from 'react';
import Tour from './Tour';


const Tours = ({ tours }) => {

  return(
    <section className='section'>
      <h2>Our Tours</h2>
      <div className='underline'></div>
      <div>
        {tours.map((tour)=>{
          return(
            <Tour {...tour} key={tour.id}></Tour>
          )
        })}
      </div>
    </section>
  );
};

export default Tours;
